	/**
	 * Compares 2 arrays a and b quasicolexicographically.
	 */

	return function (a, b) {
		const m = a.length;
		const n = b.length;

		if (m !== n) return m - n;

		const length = Math.min(m, n);

		for (let i = 1; i <= length; ++i) {
